import HeaderOnly from "./components/Layout/HeaderOnly";
import Explore from "./pages/Explore";
import Following from "./pages/Following";
import Home from "./pages/Home";
import Live from "./pages/Live";
import Upload from "./pages/Upload";

const publicRoutes = [
    {
        path: '/',
        component: Home,
    },
    {
        path: '/following',
        component: Following, 
        // layout: null
    }, 
    {
        path: '/upload',
        component: Upload,
        layout: HeaderOnly
    },
    {
        path: '/explore',
        component: Explore,
        // layout: HeaderOnly
    },
    {
        path: '/live',
        component: Live,
        // layout: HeaderOnly
    },
    {
        pa
    }
]

export {publicRoutes};
